import Phaser from "phaser";
export default class LobbyGame extends Phaser.Scene {

    constructor(){
        super('lobby-game')
    }

    init(){
       this.alas = undefined
       this.StartButton = undefined
       this.InfoButton = undefined
       this.creted = undefined
       this.backsound = undefined

       this.gameWidth = this.scale.width
       this.gameHeight = this.scale.height
    }

    preload(){
        this.load.image('background-lobby', 'images/bg-lobby.jpeg')
        this.load.image('alas', 'images/pulauTerapung.png')
        this.load.image('start', 'images/startBtn.png')
        this.load.image('info', 'images/moreInfo.png')
        this.load.image('ig', 'images/instagram.png')

        this.load.spritesheet('playerDiem-L', 'images/standing.png', {frameWidth:256, frameHeight:222})
        this.load.spritesheet('playerRun-L', 'images/walks.png', {frameWidth:256, frameHeight:222})
        this.load.spritesheet('playerLoncat-L', 'images/jump.png',{frameWidth:256, frameHeight:222})
        this.load.spritesheet('playerAtk-L', 'images/sword.png',{frameWidth:256, frameHeight:222})

        this.load.audio('lobby', 'sound/Backsound/lobbyBs.mp3')
        this.load.audio('sring', 'sound/sring.mp3')
        this.load.audio('click', 'sound/click.mp3')
    }

    create(){
        this.add.image(500,300, 'background-lobby').setScale(1.1)
        this.sound.play('lobby')
        this.alas = this.physics.add.staticImage(300,300,'alas').setScale(0.6)
        this.player = this.CreatePlayer()
        this.player.anims.play('player-diem', true).on('animationcomplete',() => {
            this.player.anims.play('player-pedang').on('animationcomplete',() => {
                this.player.anims.play('player-diem').on('animationcomplete',() => {
                    this.player.anims.play('player-pedang').on('animationcomplete',() => {
                        this.player.anims.play('player-diem').on('animationcomplete',() => {
                            this.player.anims.play('player-pedang').on('animationcomplete',() => {
                                this.player.anims.play('player-diem').on('animationcomplete',() => {
                                    this.player.anims.play('player-pedang').on('animationcomplete',() => {
                                        this.player.anims.play('player-diem')
                                    })
                                })
                            })
                        })
                    })
                })
            })
        })
        this.physics.add.collider(this.alas, this.player)

        this.StartButton = this.add.image(680,400, 'start').setInteractive().setScale(0.4)
        this.StartButton.once('pointerup', () => {
            this.sound.stopAll()
            this.sound.play('click')
            this.scene.start('fps-game-scene')
        }, this)
        // @ts-ignore
        this.InfoButton = this.add.text(50, 0, 'Fox vs Zombie', { fontFamily: 'serif', fill: '#000', fontSize: '40px' });
        // @ts-ignore
        this.creted = this.add.text(50, 40, 'Creted by DanuhPutra', { fontFamily: 'serif', fill: '#fff', fontSize: '20px' });
        var button = this.add.image(755, 40, 'info').setScale(0.2).setInteractive();
        button.on('pointerup', this.openExternalLink, this);
        var instagram = this.add.image(700, 40, 'ig').setScale(0.2).setInteractive();
        instagram.on('pointerup', this.openIg, this);
    }

    update(){

    }

    CreatePlayer(){

        // animasi 
        this.anims.create({
            key: 'player-diem',
            frames: this.anims.generateFrameNumbers('playerDiem-L', {start:0, end: 1}),
            frameRate: 1,
            repeat: 3
        }),
        this.anims.create({
            key: 'player-kanan',
            frames: this.anims.generateFrameNumbers('playerRun-L', {start:0, end: 7}),
            frameRate: 10
        }),
        this.anims.create({
            key: 'player-kiri',
            frames: this.anims.generateFrameNumbers('playerRun-L', {start:0, end: 7}),
            frameRate: 10
        }),
        this.anims.create({
            key: 'player-loncat',
            frames: this.anims.generateFrameNumbers('playerLoncat-L', {start:0, end: 5}),
            frameRate: 10
        }),
        this.anims.create({
            key: 'player-pedang',
            frames: this.anims.generateFrameNumbers('playerAtk-L', {start: 0, end: 3}),
            frameRate:6
        })
        // animasi

        const player = this.physics.add.sprite(
            290,
            200,
            'playerDiem-L'
        )
        .setScale(0.6)
        .setSize(120, 222)
        .setOffset(0, -60)


        return player
    }

    openExternalLink(){
        var url = 'https://docs.google.com/presentation/d/1cj2-xz_tgIU0i-U3ciII98MgRkY_qSBv/edit?usp=sharing&ouid=115001234637854101160&rtpof=true&sd=true';
        var s = window.open(url, '_blank');
        if (s && s.focus)
        {
            s.focus();
        }
        else if (!s)
        {
            window.location.href = url;
        }
    }

    openIg(){
        var url = 'https://www.instagram.com/danuhputra';
        var s = window.open(url, '_blank');
        if (s && s.focus)
        {
            s.focus();
        }
        else if (!s)
        {
            window.location.href = url;
        }
    }
}
